                curSeconds = objToday.getSeconds()>9?objToday.getSeconds():""0""+objToday.getSeconds()

            if (dayOrTime =");
                WriteLiteral(@"= 1) {
                return dayOfWeek;
            } else {
                return curHour + "":"" + curMinute + "":"" + curSeconds
            }


